/*
Enumerated type for the sorting algorithms
*/
export const sortingAlgorithms = {
    BUBBLE_SORT: 'bubble',
    QUICK_SORT_HOARE: 'quick-hoare',
    QUICK_SORT_LOMUNTO: 'quick-lomuto',
    MERGE_SORT: 'merge',
    SELECTION_SORT: 'selection',
}
